import { Portfolio } from "../Portfolio/Portfolio";

export const Main = () => {
    return (
      <>
      <Promo />
      <NavTab />
      <AboutProject />
      <Techs />
      <AboutMe />
      <Portfolio />
      </>
    );
  };
